data.text:
@Joannechocolat @ScottAdamsSays The fact that B/H got millions votes more than bottom DEM candidates stinks of ballot harvesting.
Because if I'm paid to harvest ballots at nurse caring homes, I'll not waste my time to get all choices, but only the top.
It may be legal, but (at least to me) is immoral.

@oOseamonkeyOo @spaceforthe @BarnettforAZ @MittRomney It was your assumption (I don't know what that was based on) that I was "so convinced".

You know nothing about me. 

I believe that there was ballot harvesting based on "Orange man bad", with the assistance of big tech, mainstream media and rich elite. That's the true fraud.
